import React from 'react'
import { useSelector } from 'react-redux'

const Users = () => {
  const Blogs = useSelector(state => state.blogs)
  console.log(Blogs)
  return(
    <div>
      <h1>Users</h1>
      {Blogs.forEach(blog => {
        return <p>blog.user.name</p>
      })}
    </div>
  )
}

export default Users
